import { Spinner } from 'reactstrap';

function App() {
  return (
    <div style={{textAlign: 'center'}}>
      <div className="App">
        <div style={{ marginTop: '40vh', fontSize: '2em'}}>
          <Spinner size="xl" color="info" />
          <p><em>christopher robin reynolds</em></p>
        </div>
      </div>
    </div>
  );
}

export default (App);
